import React from 'react'

const Contact = () => {
    const TitleStyle = {
        color: "#7fccbd",
        paddingTop: "20px",
        paddingBottom: "10px",
        fontSize: "30pt",
        fontWeight: "normal",
        margin: "0px"
    }

  return (
    <div className="container">
         <div className="inner-container">
            <h1 style={TitleStyle}>Get in Touch</h1>
         </div>
    </div>
  )
}

export default Contact
